  input: TEXT,SA11A1,SA11A1.33914,"On 12/13/04 we received a contribution from Keith
    Lochmueller in the amount of $5,000 which was deposited into our federal account.  Three
    thousand five hundred dollars was transferred to our non-federal account on 12/13/04,
    which can accept unlimited contributions from individuals.  A letter was sent
    to Keith Lochmueller on the date his check was received to advise him of how his
    deposit was split into our accounts and to offer him a chance for a refund.  According
    to AO 2001-17, the Commission has deemed it sufficient to deposit checks exceeding
    the federal limits into a federal account and then to make a transfer to the nonfederal
    account for the portion that exceeds the federal limit.  Therefore, the year-to-date
    aggregate totals reported for Ketih Lochmueller on our report is a reflection
    of the federal portion of the donor's contribution total to date."
